import React from 'react';

import styles from './../Style/Components/Messages.module.css';

import { firestore } from './../Scripts/Firebase';

import Message from './Message';

type MyProps = { SID: string };
type MyState = { Messages: Message[] };
class Messages extends React.Component<MyProps, MyState> {
  public state: MyState = { Messages: [] }
  constructor(props) {
    super(props);
    console.log(`Servers/${this.props.SID}/Messages`);
    firestore.collection(`Servers/${this.props.SID}/Messages`).limit(5).orderBy('Created', 'desc')
      .onSnapshot(async Server => {
        let Msgs: Message[] = [];
        Server.docChanges().forEach((Msg) => {
          if (Msg.type != 'removed') {
            const Data = Msg.doc.data();
            if (!Data.Created) return;
            Msgs.push(
              <Message 
                key={Msg.doc.id}
                Self="mHvcak8OjqZglBlENhQSLqBOgPB3" Owner={Data.UID} Username="Spotandjake100" Picture={Data.Picture} Content={Data.Content} />
            )
          }
        });
        this.setState({ Messages: Msgs });
      }, () => {}
    )
  }
  render() {
    console.log(this.state.Messages);
    return (
      <section className={styles.Container}>
        {this.state.Messages}
      </section>
    );
  }
}
export default Messages;
